// components/catalog/CatalogPage.jsx
import React from 'react';
import './catalog.css';

const CatalogPage = () => {
  // Зразок даних для каталогу
  const items = [
    { id: 1, name: "Tent", description: "A durable, lightweight tent for camping." },
    { id: 2, name: "Backpack", description: "A spacious backpack for all your essentials." },
    { id: 3, name: "Sleeping Bag", description: "Warm and comfortable sleeping bag for cold nights." },
    { id: 4, name: "Climbing Shoes", description: "Shoes designed for climbing and trekking." },
  ];

  return (
    <div>
      <h2>Catalog</h2>
      <ul>
        {items.map((item) => (
          <li key={item.id}>
            <h3>{item.name}</h3>
            <p>{item.description}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CatalogPage;
